functions:
  - name: parseKeyVaultKeyIdentifier(string)
    uid: '@azure/keyvault-keys.parseKeyVaultKeyIdentifier|preview'
    package: '@azure/keyvault-keys|preview'
    summary: |-
      Parses the given Key Vault Key Id. An example is:
        https://<keyvault-name>.vault.azure.net/keys/<key-name>/<unique-version-id>

      On parsing the above Id, this function returns:
      ```ts
        {
           sourceId: "https://<keyvault-name>.vault.azure.net/keys/<key-name>/<unique-version-id>",
           vaultUrl: "https://<keyvault-name>.vault.azure.net",
           version: "<unique-version-id>",
           name: "<key-name>"
        }
      ```
    remarks: ''
    isPreview: false
    isDeprecated: false
    syntax:
      content: 'function parseKeyVaultKeyIdentifier(id: string)'
      parameters:
        - id: id
          type: string
          description: |
            The Id of the Key Vault Key.
      return:
        type: <xref uid="@azure/keyvault-keys.KeyVaultKeyIdentifier|preview" />
        description: ''
